Description:
The Ministry of Defence (MOD) were inviting bids for the Platinum Edition Upgrade and Support for 1215 Citrix Licences. 
The project EMPORIUM provides adequate Citrix Licensing for Desktop as a Service (DaaS) for the Foundation Application Hosting Environment (FAHE). The Authority required the upgrade and support of 1215 Citrix Licences by 1st September for the necessary arrangements to be put in place by the commencement of the FAHE Sustainment Contract on 1st October 2016. As part of the software maintenance element of this requirement, the Customer required compliance to the following features: 
24x7x365 unlimited worldwide support; 
Product version updates; 
Unlimited amount of support incidents; 
Unlimited amount of admin contacts and; 
Reactive support for the MOD.
